import React, { Component } from 'react';
import './Home.css'

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <h1>All movies</h1>
        <ul className="movies">
          {this.props.movies.forEach(movie =>
            (<li key={movie._id} className="movie">
              <h2>{movie.title}</h2><img src={movie.poster}/>
            </li>)
          )}
        </ul>
      </div>
    );
  }
}

export default Home;
